import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { Visitor } from '../../models/visitor.class';
import '../../styles/forms.css';

const VisitorComponent = () => {
  // Person Data
  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [personalID, setPersonalID] = useState('');
  const [responsable, setResponsable] = useState('');

  // Event Data
  const [eventID, setEventID] = useState('');
  const [entryTime, setEntryTime] = useState('');
  const [exitTime, setExitTime] = useState('');
  const [date, setDate] = useState('');
  const [destination, setDestination] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    // Crear objetos de datos para persona y evento
    const personData = {
      fullName,
      email,
      phone,
      personalID,
      responsable
    };

    const eventData = {
      eventID,
      entryTime,
      exitTime,
      date,
      destination
    };

    // Hacer la solicitud POST a la ruta /person en el backend de FastAPI
    fetch('http://127.0.0.1:8000/person', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(personData)
    })
    .then(response => response.json())
    .then(data => {
      // Manejar la respuesta del backend
      console.log(data);
    })
    .catch(error => {
      // Manejar errores
      console.error(error);
    });

    // Hacer la solicitud POST a la ruta /event en el backend de FastAPI
    fetch('http://127.0.0.1:8000/event', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(eventData)
    })
    .then(response => response.json())
    .then(data => {
      // Manejar la respuesta del backend
      console.log(data);
    })
    .catch(error => {
      // Manejar errores
      console.error(error);
    });
  }

  return (
    <div>
      <div style={{ display: 'flex' }}>
        <div style={{ flex: 1 }}>
          <h2>Person Data</h2>
          <form className='va-form' onSubmit={handleSubmit}>
            <label>
              Full Name:
              <input type="text" value={fullName} onChange={event => setFullName(event.target.value)} />
            </label>
            <br />
            <label>
              Email:
              <input type="email" value={email} onChange={event => setEmail(event.target.value)} />
            </label>
            <br />
            <label>
              Phone:
              <input type="tel" value={phone} onChange={event => setPhone(event.target.value)} />
            </label>
            <br />
            <label>
              Personal ID:
              <input type="text" value={personalID} onChange={event => setPersonalID(event.target.value)} />
            </label>
            <br />
            <label>
              Responsable:
              <input type="text" value={responsable} onChange={event => setResponsable(event.target.value)} />
            </label>
          </form>
        </div>

        <div style={{ flex: 1 }}>
          <h2>Event Data</h2>
          <form className='va-form' onSubmit={handleSubmit}>
            <label>
              Event ID:
              <input type="text" value={eventID} onChange={event => setEventID(event.target.value)} />
            </label>
            <br />
            <label>
              Entry Time:
              <input type="time" value={entryTime} onChange={event => setEntryTime(event.target.value)} />
            </label>
            <br />
            <label>
              Exit Time:
              <input type="time" value={exitTime} onChange={event => setExitTime(event.target.value)} />
            </label>
            <br />
            <label>
              Date:
              <input type="date" value={date} onChange={event => setDate(event.target.value)} />
            </label>
            <br />
            <label>
              Destination:
              <input type="text" value={destination} onChange={event => setDestination(event.target.value)} />
            </label>
          </form>
        </div>
      </div>

      {/* Bot√≥n para enviar ambos formularios */}
      <input type="submit" value="Submit" onClick={handleSubmit} />
    </div>
  );
}

VisitorComponent.propTypes = {
  fullName: PropTypes.instanceOf(Visitor).isRequired,
  email: PropTypes.instanceOf(Visitor).isRequired,
  phone: PropTypes.instanceOf(Visitor).isRequired,
  personalID: PropTypes.instanceOf(Visitor).isRequired,
  responsable: PropTypes.instanceOf(Visitor).isRequired,

  eventID: PropTypes.instanceOf(Visitor).isRequired,
  entryTime: PropTypes.instanceOf(Visitor).isRequired,
  exitTime: PropTypes.instanceOf(Visitor).isRequired,
  date: PropTypes.instanceOf(Visitor).isRequired,
  destination: PropTypes.instanceOf(Visitor).isRequired,
};

export default VisitorComponent;
